import CookieCard from '../Cookie_Card/CookieCard';

import './Body.css';

function Body(props){
    return(
        <div className= 'div-body'>
            <h2>Category 1</h2>
            <hr/>
            <CookieCard cookieName={'cookie1'} price= {100} description= {'this cookie is made with love.'}/>
        </div>
    );
}

export default Body;
